En una emocionante aventura educativa, los estudiantes de  1º de primaria se embarcaron en un viaje intergaláctico para explorar los misterios del sistema

Desde la ardiente superficie de Mercurio hasta los anillos misteriosos de Saturno, cada rincón del sistema solar fue explorado con entusiasmo y dedicación. Los niños y niñas se sumergieron en el estudio de cada planeta, aprendiendo sus características únicas.

&nbsp;

Pero la aventura no terminó allí. Como culminación del proyecto, los estudiantes crearon un impresionante vídeo tutorial en el que compartieron sus conocimientos sobre el sistema solar. Con habilidades de presentación propias de expertos, explicaron cada una de las características de los planetas,

&nbsp;

El proyecto no solo ha dejado una marca indeleble en los corazones y mentes de estos jóvenes exploradores, sino que también ha demostrado el poder del aprendizaje experiencial y la creatividad en el aula. ¡El futuro del espacio está en buenas manos con estos intrépidos astronautas en formación!
